INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, "リリ", 40011, 1, 125801, 0, 24001, 2, 1, 321);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, "クリア", 40011, 1, 126001, 0, 24001, 2, 1, 322);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("んーと。\nこれ、あげる。\nはい", 3, "プレシア", 40011, 1, 126101, 0, 24001, 2, 1, 323);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 4, "リリ", 40011, 2, 125801, 0, 24001, 2, 1, 324);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 5, "クリア", 40011, 2, 126001, 0, 24001, 2, 1, 325);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("お兄。\nきてくれて、うれしい", 6, "プレシア", 40011, 2, 126101, 0, 24001, 2, 1, 326);
